So, I did make that sample that I used in my track, (check any database for audio matches. ANY.) But What I didn't like was that there was just a sample, so I added devices to make it look like it was mostly made in AT. Although, I did not expect fro people to start using the "screenshot" as proof as that It was not created on AT. But in truth, the whole reason why i kept saying that it was made in AT was because i just didn't really like the way FL studio dosent have a "viewing other tracks" feature, so i downloaded my completed version, and converted it in a mp3 sample. I apologize for any problems that my track have cuased for other people, or AudioTool Itself. it was made on multiple platforms, bit by bit, and the second track was supposed to be merged with the first, but that idea changed over time. Soon, it became two seperate tracks, both made on the same platform (s). And yes, it is true that it is NOT made on AudioTool, It is also true that i did not copy/Steal/Use AI to make this track. I just wanted it to look cool by adding more devices, and It defientley cuased problems. But now you know, it is made in multiple platforms. Here are the platforms i made them on: LoopLabs, FL studio, Amped studio, and Soundation (Freemium).

